import React from "react";
import { useSelector } from "react-redux";
import SwiperSeazons from "./SwiperSeazons";

const Seazons = () => {
  const totalSeasons = useSelector((state) => state.series.tvDetail.data);
  return (
    <div>
      <div>
        <span className="bg-yellow-500 p-1 rounded-xl font-bold text-xl text-black font-serif">
          Seasons
        </span>
        <span>{totalSeasons.number_of_seasons}</span>
      </div>
      <SwiperSeazons />
    </div>
  );
};

export default Seazons;
